description:
 Spécification: 37*15*140cm
Matériel: plastique + acier inoxydable
Caractéristique:
1. Imitation de l'arrosage manuel, gain de temps et d'effort;
2. La vadrouille s'adapte parfaitement au sol, tout comme une serviette essuie le sol et le nettoyage est fort;
3. Augmentez la tête de vadrouille et augmentez la surface de nettoyage de la terre une fois, économisant du temps et des efforts;
4. Allonger la tige de vadrouille et faire glisser le sol à nouveau sans se pencher.
5. 360 ° nettoyer, absorber les cheveux, déshydrater complètement, pas besoin de laver à la main.
